import React, { useEffect, useState } from "react";
import axios from "axios";

const CuratorProfile = () => {
  const [curator, setCurator] = useState(null);
  const [error, setError] = useState("");
  const [organizedExhibitions, setOrganizedExhibitions] = useState([]); // Exhibitions organized by curator

  const curatorId = localStorage.getItem("curatorId"); // Fetch curator ID from localStorage

  // Fetch curator profile and exhibitions on component mount
  useEffect(() => {
    if (!curatorId) {
      setError("Curator ID not found. Please log in.");
      return;
    }

    // Fetch curator profile
    axios
      .get(`http://localhost:8080/api/curators/${curatorId}`)
      .then((response) => setCurator(response.data))
      .catch((err) => {
        setError("Failed to fetch curator profile.");
        console.error(err);
      });

    // Fetch all exhibitions
    axios
      .get(`http://localhost:8080/api/exhibitions`)
      .then((response) => {
        const exhibitionsData = response.data;
        // Filter exhibitions organized by the logged-in curator
        const organized = exhibitionsData.filter(
          (exhibition) => exhibition.organizerName === curatorId
        );
        setOrganizedExhibitions(organized);
      })
      .catch((err) => {
        setError("Failed to fetch exhibitions.");
        console.error(err);
      });
  }, [curatorId]);

  if (error) {
    return (
      <div style={styles.error}>
        <p>{error}</p>
      </div>
    );
  }

  if (!curator) {
    return (
      <div style={styles.loading}>
        <p>Loading curator profile...</p>
      </div>
    );
  }

  return (
    <div style={styles.dashboardContainer}>
      {/* Left Side: Curator Profile */}
      <div style={styles.profileContainer}>
        <div style={styles.profileCard}>
          <h1 style={styles.heading}>Curator Profile</h1>
          <p>
            <strong>Name:</strong> {curator.name}
          </p>
          <p>
            <strong>Email:</strong> {curator.email}
          </p>
          <p>
            <strong>Phone:</strong> {curator.phone}
          </p>
          <p>
            <strong>Bio:</strong> {curator.bio}
          </p>
          <p>
            <strong>Joined:</strong> {curator.joinedDate}
          </p>
        </div>
      </div>

      {/* Right Side: Exhibitions Organized */}
      <div style={styles.exhibitionsContainer}>
        <h3>Exhibitions Organized</h3>
        {organizedExhibitions.length === 0 ? (
          <p>No exhibitions organized yet.</p>
        ) : (
          <ul style={styles.placesList}>
            {organizedExhibitions.map((exhibition) => (
              <li key={exhibition.id}>
                <strong>{exhibition.title}</strong> - {exhibition.dates} @ {exhibition.place}
              </li>
            ))}
          </ul>
        )}
      </div>
    </div>
  );
};

const styles = {
  dashboardContainer: {
    display: "flex",
    justifyContent: "space-between",
    padding: "20px",
    fontFamily: "'Roboto', sans-serif",
  },
  profileContainer: {
    width: "40%",
    padding: "20px",
  },
  profileCard: {
    backgroundColor: "#f9f9f9",
    padding: "20px",
    borderRadius: "8px",
    boxShadow: "0 4px 8px rgba(0, 0, 0, 0.1)",
    lineHeight: "1.6",
  },
  heading: {
    fontSize: "24px",
    marginBottom: "15px",
    color: "#333",
  },
  exhibitionsContainer: {
    width: "55%",
    padding: "20px",
    backgroundColor: "#f9f9f9",
    borderRadius: "8px",
    boxShadow: "0 4px 8px rgba(0, 0, 0, 0.1)",
  },
  placesList: {
    listStyle: "none",
    padding: 0,
  },
  error: {
    color: "red",
    textAlign: "center",
    marginTop: "20px",
  },
  loading: {
    textAlign: "center",
    marginTop: "20px",
  },
};

export default CuratorProfile;
